import React from 'react';
import './Body.css';


class Body extends React.Component {
    render(){
        return(
            <div className="content">
                <h2 className="sectionTitle">{this.props.title}</h2>
                <View
                style={{
                    borderBottomColor: 'white',
                    borderBottomWidth: 1,
                }}
                />
            </div>
        )
    }
}

export default Body;
